VALUES ('3331560000078', 'les hauts de l\'ayrolle - fitou', 'LAYROLLE FITOU APPELLATION D\'ORIGINE PROTÉGÉE Reconnue des 1948 pour la qualité de ses terroirs et de Firou est la plus ancienne appellation d\'origine protee Languedoc. Blotti au caeur du haut Fitou, le temir TAyrolle est un écrin remarquable pour cette sélecin ieilles vignes. Cete cuvée est éclatante de fraîcheur, de vigueure caractère. En bouche, se mélent des arômes de vanile poivre et de cassis. Cette palette harmonieuse et riche seg sur un fond dense et équilibré. Pret à déguster dès à présent, ce grand Fitou sépanouin bonheur en cave 2 à 3 ans. MIS EN BOUTEILLE À LA PROPRIETE PAR EMB 11R33 À F11360-071 PRODUIT DE FRANCE 148 8101 Sud de Taomit', 'https://static.openfoodfacts.org/images/products/333/156/000/0078/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '13.5', '0');

